import React from "react";
import todoData from './todoData.json';
import Todo from './Todo';

const Header = ({ title }) => {
  return (
    <>
      <h1>{title}</h1>
    </>
  );
};

const App = () => {
  const title = 'Todo List';

  return (
    <>
      <Header title={title} />
      {todoData.todos.map((value, index) => (
        <Todo
          id={value.id}
          task={value.task}
          completed={value.completed}
          priority={value.priority}
        />
      ))}
    </>
  );
};

export default App;
